12	Heading Info	<a href="http://tel:303-477-8888">303-477-8888</a>\r\n<p \\n="" p="">\r\n<a href="https://goo.gl/maps/ZUEWEdgjicdbeUJM8">2707 W. 38th Ave.<br>Denver, CO 80211</a>\r\n\r\n</p><p>open 8am - 10pm daily<br></p><p></p>	2019-07-13 19:11:14.210974+00
10	Location	<p><span style="font-size: 36px;">Location</span></p><p>We are conveniently located at 2707 W 38th Ave and Clay St., in the beautiful Denver Highlands neighborhood, first traffic light east of Federal Blvd.  Look for the green colored building with blue awnings on the north side.  Our front door is in between the florist and the liquor store.  Feel free to park in either parking lot.</p>	2019-07-14 05:27:23.028571+00
5	Welcome Message	<p><span style="font-size: 24px;">Welcome to</span></p><p><span style="font-size: 36px; color: rgb(57, 123, 33);">The Giving Tree of Denver</span></p><p><span style="font-size: 18px; color: rgb(107, 165, 74); background-color: rgb(255, 231, 156);">SERVING MEDICAL PATIENTS&nbsp; 21+ AND RECREATIONAL ADULTS!</span></p><p>Established in 2009, The Giving Tree of Denver continually strives to provide the highest quality cannabis products in the Colorado market. Today we boast the largest selection of edibles in the city. We serve the particular needs of medical marijuana patients in our comfortable, safe and friendly atmosphere. In addition to our membership program for medical marijuana patients, we offer a 10% discount for Veterans, students, and cannabis industry staff.***</p><p>Our quality products and family-style customer service set us apart from other dispensaries. Our highly knowledgeable and professional staff are here to help you experience the industry's finest cannabis products- including&nbsp; infused products, concentrates topicals, tinctures, beverages, edibles, and premium-quality flower.&nbsp;</p><p>We cordially invite you to visit our store and experience the Giving Tree of Denver!</p><p><span style="font-size: 10px;">***Must bring valid government issued proof of identification.</span></p>	2019-07-13 19:31:39.016354+00
13	About Us Bottom	<p>The Giving Tree of Denver, founded in 2009, located in the beautiful Highlands neighborhood right outside of downtown Denver boasts a staff with extensive knowledge of the Colorado cannabis industry and its finest products. With the largest selection of edibles in Denver, you will find the diversity of our inventory allows for a more personalized experience, and a tasty treat too!<br></p>	2019-07-14 05:34:21.552978+00
11	Membership	<p>Change your medical marijuana center and member benefits! Simply complete the form below and bring your government-issued photo ID or passport and Colorado medical marijuana card into the Giving Tree to receive 3.5 grams of flower and one pre-rolled joint with a $30 purchase on the day of your signover!</p>\r\n<p><a href="/TEMPLATE-Change-Of-PMMC.pdf" target="_blank">Click this link to download the form!</a></p>	2019-07-14 04:04:04.680324+00
9	Main Logo	<img src="https://storage.googleapis.com/tgtree/tgtree-of-denver_final_logo_no_rays-1-copypng">	2019-07-20 03:31:11.078611+00
3	About Us	<p><span style="font-size: 36px; color: rgb(57, 123, 33);">About Us</span></p><p><img src="https://storage.googleapis.com/tgtree/store_main_counterjpeg" style="width: 100%; float: left;" class="note-float-left"><span style="font-size: 36px;"><br></span></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p>The Giving Tree of Denver, founded in 2009, located in the beautiful Highlands neighborhood right outside of downtown Denver boasts a staff with extensive knowledge of the Colorado cannabis industry and its finest products. With the largest selection of edibles in Denver, you will find the diversity of our inventory allows for a more personalized experience, and a tasty treat too!</p><p>Our number one priority is to provide safe, professional service to medical marijuana patients and recreational adult consumers. Our staff provides a wealth of knowledge of the industry's latest and greatest products and technologies.  Our expert growers are always researching new and safe organic materials to provide our patients with only the safest and highest quality flower in Denver.</p><p>Let us become your preferred dispensary in Denver!</p>	2019-07-13 19:29:22.163432+00
